let facturacion={Init:function(){console.log("Facturacion core"),core.Forms.initializeSelectData(),facturacion.Events()},Events:function(){$("body").on(core.helper.clickEventType,".btnGenerarInformePrefacturacion",(function(){facturacion.Prefacturacion.generarInformePrefacturacion()}))},Prefacturacion:{generarInformePrefacturacion:function(){var fechaDesde=$(".fechaDesde").val(),fechaHasta=$(".fechaHasta").val(),administradorId=$("#usuarioId option:selected").val(),nombreAdministrador=$("#usuarioId option:selected").text();if(""==fechaHasta||""!=fechaDesde){var datos=Object();datos.fechaDesde=fechaDesde,datos.fechaHasta=fechaHasta,datos.nombreAdministrador=nombreAdministrador,apiFincatech.post(`facturacion/prefacturacion/${administradorId}`,datos).then(result=>{var data=JSON.parse(result);console.log(data),window.open(data.data)})}else CoreUI.Modal.Error("Proporcione la fecha desde para generar el informe")}}};$(()=>{"Prefacturacion"==core.model&&facturacion.Init()});